const ControlPresupuesto = () => {
    ( 
        <Fragment>
            <div className="alert alert-primary">
                Presupuesto:
            </div>

            <div className="alert">
                Restante:
            </div>
        </Fragment>     
    );
}
 
export default ControlPresupuesto;
